[dscrd-hush] <ITM> I was checking the notary code and nodes codes.  It written just a way that notarizing against any other chain is possible, even multiple notarization possible
{
notarized: defaultheight,
customNotarize: {
btc: defaultheight
xrp: xrpheight
xlm: xlmheight
}

So if they add xlm and the exchange decides that xlm is trusted, confirmation can take 2.5minutes!
